import React from 'react';
import NavLink from './NavLink';
import { navLinks } from './navLinks';
import './Nav.css';

const Nav = () => {
	return (
		<>
			<nav>
				{navLinks.map(({ navLinkId, scrollToId }, idx) => (
					<NavLink key={idx} navLinkId={navLinkId} scrollToId={scrollToId} />
				))}
			</nav>
			<p>Smart Proteins</p>
		</>
	);
};

export default Nav;
